// import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom'

function App() {
  const change = (event) => {
    alert(event)
  }

  return (
    <div className="App">
      <h2>Login Page</h2><br />
      <input type="text" name="username" id="username" /><br />
      <input type="text" name="password" id="password" /><br />
      <input type="submit" value="submit" onClick={(event)=>change(event)}/>
    </div>
  );
}

export default App;
